import React from 'react';
import ThreeStepGuide from './ThreeStepGuide'
import MediaLogosSection from './MediaLogosSection';
import ReviewSlider from './ReviewSlider';
import ShopByCategory from './ShopByCategory';
import WhyBitsAreBetter from './WhyBitsAreBetter';
import ShopByCategoryB from './ShopByCategoryB';
import SimpleTestimonialSlider from './SimpleTestimonialSlider';
import FAQSection from './FAQSection';
import Hero from './Hero';
// import ProductList from '../../BiteData/ProductList';

const BiteHome = ({addToCart}) => {
  return (
    <>
      <Hero />
      <MediaLogosSection />
      <ThreeStepGuide />
      <ReviewSlider />
      <ShopByCategory />
      <WhyBitsAreBetter />
      <ShopByCategoryB addToCart={addToCart} />
      <SimpleTestimonialSlider />
      <FAQSection />
    </>
  );
};

export default BiteHome;
